import React from "react";


import styles from './Inventory.module.css';

const Inventory = (props) =>{

    props.getPage('manage-inventory');
    return(
        <div className={`${styles.container}`}>
            <p>Inventory</p>
        </div>
    )
}

export default Inventory;
